  return (
    <div>
      <Route path="/add-quote">
        <AddQuote></AddQuote>
      </Route>
      <Route path="/all-quote">
        <AllQuote></AllQuote>
      </Route>
      <Route path="/quote-detail">
        <AllQuote></AllQuote>
      </Route>
    </div>
  );
}

export default App;
